INSERT INTO `movies` (`id`, `tmdb_id`, `title`, `original_title`, `overview`, `poster_path`, `media_type`, `backdrop_path`, `is_adult`, `original_language`, `popularity`, `release_date`, `is_video`, `vote_average`, `vote_count`, `time_window`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 1029955, 'Kinds of Kindness', 'Kinds of Kindness', 'A triptych fable following a man without choice who tries to take control of his own life; a policeman who is alarmed that his wife who was missing-at-sea has returned and seems a different person; and a woman determined to find a specific someone with a special ability, who is destined to become a prodigious spiritual leader.', '/8mmpltkcG9areafsQHXaURedno3.jpg', 'movie', '/4gOB72zD9udHk3jAR0reHwgURZp.jpg', 0, 'en', 172.724, '2024-05-30', 0, 6.8, 378, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(2, 1226578, 'Longlegs', 'Longlegs', 'FBI Agent Lee Harker is assigned to an unsolved serial killer case that takes an unexpected turn, revealing evidence of the occult. Harker discovers a personal connection to the killer and must stop him before he strikes again.', '/5aj8vVGFwGVbQQs26ywhg4Zxk2L.jpg', 'movie', '/tabKOXkHRu6Nho2VOYrnyAirtY7.jpg', 0, 'en', 1098.629, '2024-07-10', 0, 6.55, 449, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(3, 826510, 'Harold and the Purple Crayon', 'Harold and the Purple Crayon', 'Inside of his book, adventurous Harold can make anything come to life simply by drawing it. After he grows up and draws himself off the book\'s pages and into the physical world, Harold finds he has a lot to learn about real life.', '/dEsuQOZwdaFAVL26RjgjwGl9j7m.jpg', 'movie', '/6IrZ3C8qSZ8Tbb32s41ReJOXpI0.jpg', 0, 'en', 80.042, '2024-07-31', 0, 6.6, 25, 'day', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:06'),
(4, 1022789, 'Inside Out 2', 'Inside Out 2', 'Teenager Riley\'s mind headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new Emotions! Joy, Sadness, Anger, Fear and Disgust, who’ve long been running a successful operation by all accounts, aren’t sure how to feel when Anxiety shows up. And it looks like she’s not alone.', '/vpnVM9B6NMmQpWeZvzLvDESb2QY.jpg', 'movie', '/stKGOm8UyhuLPR9sZLjs5AkmncA.jpg', 0, 'en', 2203.934, '2024-06-11', 0, 7.682, 3067, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(5, 939243, 'Sonic the Hedgehog 3', 'Sonic the Hedgehog 3', 'Sonic, Knuckles, and Tails reunite against a powerful new adversary, Shadow, a mysterious villain with powers unlike anything they have faced before. With their abilities outmatched in every way, Team Sonic must seek out an unlikely alliance in hopes of stopping Shadow and protecting the planet.', '/lgJMRZJZfy3VVrdN4WYwiIzL5gR.jpg', 'movie', '/waLxHxN9n1xL8rSmZOoOITbfiC5.jpg', 0, 'en', 138.162, '2024-12-20', 0, 0, 0, 'day', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:06'),
(6, 970347, 'The Killer', 'The Killer', 'Zee is a feared contract killer known as \"the Queen of the Dead,\" but when she refuses to murder a young blind woman, she finds herself hunted both by criminal colleagues and a determined police detective.', '/6PCnxKZZIVRanWb710pNpYVkCSw.jpg', 'movie', '/tCQfubckzzcuCbsGugkpLhfjS5z.jpg', 0, 'en', 233.541, '2024-08-22', 0, 6.149, 47, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(7, 945961, 'Alien: Romulus', 'Alien: Romulus', 'While scavenging the deep ends of a derelict space station, a group of young space colonizers come face to face with the most terrifying life form in the universe.', '/b33nnKl1GSFbao4l3fZDDqsMx0F.jpg', 'movie', '/9SSEUrSqhljBMzRe4aBTh17rUaC.jpg', 0, 'en', 997.712, '2024-08-13', 0, 7.212, 669, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(8, 533535, 'Deadpool & Wolverine', 'Deadpool & Wolverine', 'A listless Wade Wilson toils away in civilian life with his days as the morally flexible mercenary, Deadpool, behind him. But when his homeworld faces an existential threat, Wade must reluctantly suit-up again with an even more reluctant Wolverine.', '/8cdWjvZQUExUUTzyp4t6EDMubfO.jpg', 'movie', '/yDHYTfA3R0jFYba16jBB1ef8oIt.jpg', 0, 'en', 4467.772, '2024-07-24', 0, 7.764, 2437, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(9, 1008953, 'Incoming', 'Incoming', 'Their first week of high school. The biggest party of the year. Mistakes will be made as four teenage boys navigate a night of mayhem and debauchery.', '/hQlFyelFIyBDKrm9B1ghlA4KJmr.jpg', 'movie', '/azDmSHPzQP61OKHzpDJ7nXrG4QP.jpg', 0, 'en', 342.727, '2024-08-22', 0, 5.836, 61, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(10, 718821, 'Twisters', 'Twisters', 'As storm season intensifies, the paths of former storm chaser Kate Carter and reckless social-media superstar Tyler Owens collide when terrifying phenomena never seen before are unleashed. The pair and their competing teams find themselves squarely in the paths of multiple storm systems converging over central Oklahoma in the fight of their lives.', '/pjnD08FlMAIXsfOLKQbvmO0f0MD.jpg', 'movie', '/58D6ZAvOKxlHjyX9S8qNKSBE9Y.jpg', 0, 'en', 1594.068, '2024-07-10', 0, 7.032, 1106, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(11, 957452, 'The Crow', 'The Crow', 'Soulmates Eric and Shelly are brutally murdered when the demons of her dark past catch up with them. Given the chance to save his true love by sacrificing himself, Eric sets out to seek merciless revenge on their killers, traversing the worlds of the living and the dead to put the wrong things right.', '/9jCKijsyrEea55f01TDgcMEqKvK.jpg', 'movie', '/Asg2UUwipAdE87MxtJy7SQo08XI.jpg', 0, 'en', 306.815, '2024-08-21', 0, 5.288, 59, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(12, 1029330, 'Someone Like You', 'Someone Like You', 'Shocking news hits after young architect Dawson loses his best friend London. In his heartbreak, Dawson is compelled to launch an impossible search for London’s secret sister, twins separated as embryos. But along the way, Dawson never planned to fall in love.', '/zsvD0BjEQIIoh2PpE5X7VXmSrQO.jpg', 'movie', '/me5rUyfsVy6ixHpqVmmTVegHv15.jpg', 0, 'en', 24.038, '2024-04-02', 0, 5, 6, 'day', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:06'),
(13, 704239, 'The Union', 'The Union', 'A New Jersey construction worker goes from regular guy to aspiring spy when his long-lost high school sweetheart recruits him for an espionage mission.', '/d9CTnTHip1RbVi2OQbA2LJJQAGI.jpg', 'movie', '/4ft6TR9wA6bra0RLL6G7JFDQ5t1.jpg', 0, 'en', 1401.788, '2024-08-15', 0, 6.283, 415, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(14, 1327530, 'The Lockdown', 'The Lockdown', 'Siblings Charlie and Jack are trapped in Myanmar\'s toughest prison and accused of a crime they didn\'t commit. Forced into televised fights against other inmates, they must work together and fight for their freedom.', '/78ZjjWtG2AxHMo9buTJbzXsbTJq.jpg', 'movie', '/qjZUL1ajr94Vax9KQJ3joD3C3qH.jpg', 0, 'en', 10.858, '2024-08-16', 0, 7, 2, 'day', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:06'),
(15, 1079091, 'It Ends with Us', 'It Ends with Us', 'When a woman\'s first love suddenly reenters her life, her relationship with a charming, but abusive neurosurgeon is upended, and she realizes she must learn to rely on her own strength to make an impossible choice for her future.', '/AjV6jFJ2YFIluYo4GQf13AA1tqu.jpg', 'movie', '/9BQqngPfwpeAfK7c2H3cwIFWIVR.jpg', 0, 'en', 1305.738, '2024-08-07', 0, 6.9, 194, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(16, 519182, 'Despicable Me 4', 'Despicable Me 4', 'Gru and Lucy and their girls—Margo, Edith and Agnes—welcome a new member to the Gru family, Gru Jr., who is intent on tormenting his dad. Gru also faces a new nemesis in Maxime Le Mal and his femme fatale girlfriend Valentina, forcing the family to go on the run.', '/wWba3TaojhK7NdycRhoQpsG0FaH.jpg', 'movie', '/lgkPzcOSnTvjeMnuFzozRO5HHw1.jpg', 0, 'en', 1687.022, '2024-06-20', 0, 7.261, 1279, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(17, 974250, 'Greedy People', 'Greedy People', 'The eclectic residents of a small, picturesque island town must navigate a sensational murder and the discovery of a million dollars, leading to a series of increasingly bad decisions which upend the once-peaceful community.', '/aIUZiciO0nMh8MrhmsTaMWZvEWK.jpg', 'movie', '/1UzAEzVO34cBAQ5Hk3r7QoqK42P.jpg', 0, 'en', 114.59, '2024-08-23', 0, 5.447, 19, 'day', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:06'),
(18, 840705, 'Blink Twice', 'Blink Twice', 'When tech billionaire Slater King meets cocktail waitress Frida at his fundraising gala, he invites her to join him and his friends on a dream vacation on his private island. But despite the epic setting, beautiful people, ever-flowing champagne, and late-night dance parties, Frida can sense that there’s something sinister hiding beneath the island’s lush façade.', '/lWAmlOktRVggBTIfe13JnNxuIOp.jpg', 'movie', '/dTaqzXA1auKRUjHPQjR3u0W7Gfl.jpg', 0, 'en', 257.78, '2024-08-21', 0, 6.939, 90, 'day', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:06'),
(19, 348, 'Alien', 'Alien', 'During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.', '/vfrQk5IPloGg1v9Rzbh2Eg3VGyM.jpg', 'movie', '/AmR3JG1VQVxU8TfAvljUhfSFUOx.jpg', 0, 'en', 376.731, '1979-05-25', 0, 8.154, 14372, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(20, 956842, 'Fly Me to the Moon', 'Fly Me to the Moon', 'Sparks fly in all directions as marketing maven Kelly Jones, brought in to fix NASA\'s public image, wreaks havoc on Apollo 11 launch director Cole Davis\' already difficult task of putting a man on the moon. When the White House deems the mission too important to fail, Jones is directed to stage a fake moon landing as backup, and the countdown truly begins.', '/gjk8YdXpItoC1in53FCrZMFIuBx.jpg', 'movie', '/zB0g0VaRKHfRrvBT4ouHK5W967W.jpg', 0, 'en', 330.61, '2024-07-10', 0, 6.982, 352, 'week', NULL, '2024-08-28 01:53:06', '2024-08-28 01:53:24'),
(21, 1094138, 'Jackpot!', 'Jackpot!', 'In the near future, a \'Grand Lottery\' has been established - the catch: kill the winner before sundown to legally claim their multi-billion dollar jackpot. When Katie Kim mistakenly finds herself with the winning ticket, she reluctantly joins forces with amateur lottery protection agent Noel Cassidy who must get her to sundown in exchange for a piece of her prize.', '/fOsamTFIyGxjw1jLSKdZYxQBJOT.jpg', 'movie', '/pzFbYJfqGKlGxOsDIIsUi6YxVQ.jpg', 0, 'en', 1167.017, '2024-08-13', 0, 6.412, 324, 'week', NULL, '2024-08-28 01:53:24', '2024-08-28 01:53:24'),
(22, 786892, 'Furiosa: A Mad Max Saga', 'Furiosa: A Mad Max Saga', 'As the world fell, young Furiosa is snatched from the Green Place of Many Mothers and falls into the hands of a great Biker Horde led by the Warlord Dementus. Sweeping through the Wasteland they come across the Citadel presided over by The Immortan Joe. While the two Tyrants war for dominance, Furiosa must survive many trials as she puts together the means to find her way home.', '/iADOJ8Zymht2JPMoy3R7xceZprc.jpg', 'movie', '/wNAhuOZ3Zf84jCIlrcI6JhgmY5q.jpg', 0, 'en', 623.177, '2024-05-22', 0, 7.592, 2848, 'week', NULL, '2024-08-28 01:53:24', '2024-08-28 01:53:24'),
(23, 653346, 'Kingdom of the Planet of the Apes', 'Kingdom of the Planet of the Apes', 'Several generations following Caesar\'s reign, apes – now the dominant species – live harmoniously while humans have been reduced to living in the shadows. As a new tyrannical ape leader builds his empire, one young ape undertakes a harrowing journey that will cause him to question all he\'s known about the past and to make choices that will define a future for apes and humans alike.', '/gKkl37BQuKTanygYQG1pyYgLVgf.jpg', 'movie', '/fypydCipcWDKDTTCoPucBsdGYXW.jpg', 0, 'en', 685.005, '2024-05-08', 0, 7.143, 2651, 'week', NULL, '2024-08-28 01:53:24', '2024-08-28 01:53:24'),
(24, 762441, 'A Quiet Place: Day One', 'A Quiet Place: Day One', 'As New York City is invaded by alien creatures who hunt by sound, a woman named Sam fights to survive with her cat.', '/hU42CRk14JuPEdqZG3AWmagiPAP.jpg', 'movie', '/6XjMwQTvnICBz6TguiDKkDVHvgS.jpg', 0, 'en', 938.313, '2024-06-26', 0, 6.858, 1505, 'week', NULL, '2024-08-28 01:53:24', '2024-08-28 01:53:24'),
(25, 1059064, 'The Instigators', 'The Instigators', 'Rory and Cobby are unlikely partners thrown together for a heist. But when it goes awry, they team up to outrun police, backward bureaucrats, and a vengeful crime boss.', '/pIz9csYn1yjrzQi0BuBZNJrTMi0.jpg', 'movie', '/8sl07rkrNnZzTqRKWSKnk6bLnTZ.jpg', 0, 'en', 663.771, '2024-08-02', 0, 6.246, 244, 'week', NULL, '2024-08-28 01:53:24', '2024-08-28 01:53:24'),
(26, 573435, 'Bad Boys: Ride or Die', 'Bad Boys: Ride or Die', 'After their late former Captain is framed, Lowrey and Burnett try to clear his name, only to end up on the run themselves.', '/oGythE98MYleE6mZlGs5oBGkux1.jpg', 'movie', '/3q01ACG0MWm0DekhvkPFCXyPZSu.jpg', 0, 'en', 1469.895, '2024-06-05', 0, 7.6, 1731, 'week', NULL, '2024-08-28 01:53:24', '2024-08-28 01:53:24');
