movie\",\"backdropPath\":\"\\/6IrZ3C8qSZ8Tbb32s41ReJOXpI0.jpg\",\"isAdult\":false,\"originalLanguage\":\"en\",\"popularity\":80.042,\"releaseDate\":\"2024-07-31 00:00:00\",\"isVideo\":false,\"voteAverage\":6.6,\"voteCount\":25,\"timeWindow\":\"day\",\"createdAt\":\"2024-08-28 01:53:06\",\"updatedAt\":\"2024-08-28 01:53:06\"},{\"id\":4,\"tmdbId\":1022789,\"title\":\"Inside Out 2\",\"originalTitle\":\"Inside Out 2\",\"overview\":\"Teenager Riley\'s mind headquarters is undergoing a sudden demolition to make room for something entirely unexpected: new Emotions! Joy, Sadness, Anger, Fear and Disgust, who\\u2019ve long been running a successful operation by all accounts, aren\\u2019t sure how to feel when Anxiety shows up. And it looks like she\\u2019s not alone.\",\"posterPath\":\"\\/vpnVM9B6NMmQpWeZvzLvDESb2QY.jpg\",\"mediaType\":\"movie\",\"backdropPath\":\"\\/stKGOm8UyhuLPR9sZLjs5AkmncA.jpg\",\"isAdult\":false,\"originalLanguage\":\"en\",\"popularity\":2203.934,\"releaseDate\":\"2024-06-11 00:00:00\",\"isVideo\":false,\"voteAverage\":7.682,\"voteCount\":3067,\"timeWindow\":\"week\",\"createdAt\":\"2024-08-28 01:53:06\",\"updatedAt\":\"2024-08-28 01:53:24\"},{\"id\":5,\"tmdbId\":939243,\"title\":\"Sonic the Hedgehog 3\",\"originalTitle\":\"Sonic the Hedgehog 3\",\"overview\":\"Sonic, Knuckles, and Tails reunite against a powerful new adversary, Shadow, a mysterious villain with powers unlike anything they have faced before. With their abilities outmatched in every way, Team Sonic must seek out an unlikely alliance in hopes of stopping Shadow and protecting the planet.\",\"posterPath\":\"\\/lgJMRZJZfy3VVrdN4WYwiIzL5gR.jpg\",\"mediaType\":\"movie\",\"backdropPath\":\"\\/waLxHxN9n1xL8rSmZOoOITbfiC5.jpg\",\"isAdult\":false,\"originalLanguage\":\"en\",\"popularity\":138.162,\"releaseDate\":\"2024-12-20 00:00:00\",\"isVideo\":false,\"voteAverage\":0,\"voteCount\":0,\"timeWindow\":\"day\",\"createdAt\":\"2024-08-28 01:53:06\",\"updatedAt\":\"2024-08-28 01:53:06\"},{\"id\":6,